import React from 'react';
import { Container,Card,Carousel,Button} from 'react-bootstrap';
import Sidebar from './SideBar';
import logo from "../assets/img/admin.png";

export default function Home() {
    return (
      <div>
        <Sidebar title={"Home"} />
        <Container className='jumbotron' style = {{marginTop:50,width:"70%"}}>
          <h1>Welcome back !</h1>
          <p>
            You have logged in FiuFit administrator mode
          </p>
          <p>
            <Button>Learn more</Button>
          </p>
        </Container>
        <Card className="bg-light mb-3">
          <Card.Body>
            <Card.Title> <h1>Welcome back !</h1> Welcome to the Fitness App Administrator Panel!</Card.Title>
            <Card.Text>
              From here, you can manage all aspects of the app, including users, workouts, and trainers.
            </Card.Text>
            <Button variant="primary" href="/dashboard">Go to Dashboard</Button>
          </Card.Body>
        </Card>
      </div>
    );
  };
